	+mncx2*(d_(mnci1,mnci2)*d_(mnci3,mnci4)-d_(mnci1,mnci4)*d_(mnci2,mnci3))
	+mncx3*(d_(mnci1,mnci3)*d_(mnci2,mnci4)-d_(mnci1,mnci2)*d_(mnci3,mnci4));

